import React, { Component, createRef } from "react";

export class List extends Component {
  left = "<";
  right = ">";
  refGroup1 = createRef();
  refGroup2 = createRef();

  constructor(props) {
    super(props);

    this.state = {
      group1: ["AJAX", "JQuery", "Javascript", "MooTools", "Prototype", "Doja"],
      group2: ["ASP.net", "C#", "VB.net", "Java", "PHP", "Python"],
    };
  }
  clickHandlerRight = () => {};
  clickHandlerLeft = () => {};
  render() {
    return (
      <div id="container">
        <div className="groups">
          Group 1
          <select id="group1" size="10" multiple>
            {this.state.group1.map((item) => (
              <option>{item}</option>
            ))}
          </select>
        </div>
        <div id="buttons">
          <button onClick={this.clickHandlerRight}>{this.right}</button>
          <button onClick={this.clickHandlerLeft}>{this.left}</button>
        </div>
        <div className="groups">
          Group 2
          <select id="group2" size="10" multiple>
            {this.state.group2.map((item) => (
              <option>{item}</option>
            ))}
          </select>
        </div>
      </div>
    );
  }
}

export default List;
